INSERT INTO `html_parts` VALUES (1,0,1,'CSS','css/main.css.default','kimonon/css/main.css','0000-00-00 00:00:00','0000-00-00 00:00:00'),(2,1,0,'ヘッダーロゴ','<p><a href=\"/\"><img src=\"https://imgur.com/C21YLCQ.png\" alt=\"マレント\" class=\"header-logo\" width=\"350\"></a></p>\r\n<h1 class=\"header_top\">CtoC・マッチングサイト構築CMS</h1>','<p><a href=\"/\"><img src=\"https://i.imgur.com/logo.jpg\" alt=\"RELEASE\" class=\"header-logo\" width=\"350\"></a></p>\r\n<h1 class=\"header_top\">RELEASE ＳＨＯＰＰＩＮＧ</h1>\r\n<!--ctn1f2A.png-->','0000-00-00 00:00:00','2020-09-01 10:00:26'),(3,2,0,'左カラム最上段','<a href=\"#\"><img src=\"https://imgur.com/u6zqsZY.jpg\" alt=\"左カラムバナー\" class=\"img-responsive\" width=\"250px\"></a>','<a href=\"#\"><img src=\"https://imgur.com/h0gKt9o.jpg\" alt=\"左カラムバナー\" class=\"img-responsive\" width=\"250px\"></a>','0000-00-00 00:00:00','2018-11-26 12:12:53'),(4,3,0,'トップページ上部','<ul class=\"product_nav clearfix\" style=\"padding-left: 0px;\">\r\n  <li class=\"mr15\"><a href=\"#\"><img src=\"https://imgur.com/cvJbPYl.png\" alt=\"トップ上部バナー\" width=\"695px\"></a></li>\r\n</ul>\r\n<br>\r\n<ul class=\"product_nav clearfix\" style=\"padding-left: 0px;\">\r\n  <li class=\"mr15\"><a href=\"#\"><img src=\"https://imgur.com/Oz3ZOm5.png\" alt=\"トップ上部バナー\" width=\"221px\"></a></li>\r\n  <li class=\"mr15\"><a href=\"#\"><img src=\"https://imgur.com/Oz3ZOm5.png\" alt=\"トップ上部バナー\" width=\"221px\" ></a></li>\r\n  <li><a href=\"#\"><img src=\"https://imgur.com/Oz3ZOm5.png\" alt=\"トップ上部バナー\" width=\"221px\"></a></li>\r\n</ul>','<a href=\"https://shop.release.sc/lp-commerce/\" target=\"_blank\"><img src=\"/kimonon/img/shop-banner.png\" alt=\"RELEASEのフリーマーケットサイトRELEASE COMMERCE 出品者大募集\"></a>\r\n<a href=\"https://www.dreamnews.jp/press/0000223074/\" target=\"_blank\"><img src=\"/kimonon/img/banner02.png\" alt=\"RELEASEのフリーマーケットサイトRELEASE COMMERCE 出品者大募集\"></a>\r\n<a href=\"https://www.dreamnews.jp/press/0000223608/\" target=\"_blank\"><img src=\"/kimonon/img/image02.png\" alt=\"実りの秋！無料出品キャンペーン\"></a>\r\n\r\n <!--slider復帰時は下記を使用\r\n<section class=\"lazy slider\">\r\n    <div>\r\n      <a><img src=\"/kimonon/img/banner1.png?2\" alt=\"RELEASEのフリーマーケットサイトRELEASE COMMERCE\"></a>\r\n    </div>\r\n    <div>\r\n       <a><img src=\"/kimonon/img/banner2.png\" alt=\"SNS投稿でポイント貯まる使える\"></a>\r\n    </div>\r\n </section>\r\n-->\r\n\r\n','0000-00-00 00:00:00','2020-10-09 10:48:00'),(5,4,0,'購入者ガイド','<h4 class=\"ml30 spml_0 mb10 f14 strong\">1．まずは新規会員登録</h4>\r\n<p class=\"ml30 spml_0\">新規会員登録は、必要事項を入力するだけでとても簡単です。<br>\r\n  登録したメールアドレスに届く登録認証メールをクリックし、完了します。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/MGswudO.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">2．サイトにログイン</h4>\r\n<p class=\"ml30 spml_0 mb20\">会員登録時に入力した登録情報（メールアドレスとパスワード）を入力し、\r\n  「ログイン」ボタンをクリックして、ログインして下さい。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/MGswudO.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">3．購入したい商品をカートに入れて購入手続きを開始</h4>\r\n\r\n<p class=\"ml30 spml_0 mb20\">購入希望商品を1点ずつ「カートに入れる」ボタンをクリックしてショッピングカートに入れます。\r\n  購入希望商品全てをカートに入れ終わりましたら、「カートの中」ボタンをクリックし、購入手続きに進みます。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/MGswudO.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">4．カート内の商品を確認</h4>\r\n<p class=\"ml30 spml_0 mb20\">カート内の商品を確認して下さい。<br>\r\n  もし必要のない商品がある場合はカートから削除して下さい。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/MGswudO.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 mb10 f14 strong\">5．ポイントをクレジット決済で追加</h4>\r\n<p class=\"ml30 spml_0 mb20\">ポイント決済用のポイントをクレジット決済で追加します。\r\n  クレジットカードの情報は、入力方法に従って正確に入力して下さい。<br>\r\n  最後に「購入完了」ボタンをクリックすると、ポイントは追加されます。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/MGswudO.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">6．商品をポイント決済</h4>\r\n<p class=\"ml30 spml_0 mb20\">事前に購入されたポイントを使用して商品のポイント決済を行います。\r\n  ご注文のお支払金額合計を確認して下さい。<br>\r\n  問題がなければ、「購入手続きに進む」をクリックしてポイント決済ページへ進んで下さい。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/MGswudO.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 mb10 f14 strong\">7．購入した商品・サービスをそれぞれダウンロード</h4>\r\n<p class=\"ml30 spml_0 mb20\">「マイページ」内の「注文履歴・購入商品」ページを開くと、購入商品のリストが表示されます。<br>\r\n  ダウンロード商品の場合はダウンロードを行い、サービス商品であれば出品者に購入済みの旨を伝え作業を開始してもらいます。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/MGswudO.png\" alt=\"\" class=\"guide_img\">\r\n</div>','<h4 class=\"ml30 spml_0 mb10 f14 strong\">1．RELEASEコマースへ新規会員登録</h4>\r\n<p class=\"ml30 spml_0\"><a href=\"https://shop.release.sc/member_regist\" target=\"_blank\"><u>新規会員登録</u></a>は、会員利用規約に同意後、必要事項を入力し登録を確定します。<br>\r\n  登録確定後、登録したメールアドレスに届く新規登録完了メール内の「認証用URL」をクリックし、完了します。 </p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/sale_img1.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">2．サイトにログイン</h4>\r\n<p class=\"ml30 spml_0 mb20\"><a href=\"https://shop.release.sc/mypage/login\" target=\"_blank\"><u>ログインページ</u></a>にて、会員登録時に入力した登録情報（メールアドレスとパスワード）を入力し、\r\n  「ログイン」ボタンをクリックして、ログインして下さい。 </p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/sale_img2.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">3．購入したい商品をカートに入れて購入手続きを開始</h4>\r\n\r\n<p class=\"ml30 spml_0 mb20\">購入希望商品を1点ずつ「カートに入れる」ボタンをクリックしてショッピングカートに入れ、購入手続きに進みます。 </p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/buy_img3.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">4．カート内の商品を確認、ポイント購入について</h4>\r\n<p class=\"ml30 spml_0 mb20\">カート内の商品を確認して下さい。<br>\r\n  もし必要のない商品がある場合はカートから削除して下さい。<br>\r\n<font color=\"#FF0000\">※画面は開発中の画面の為、変更になる場合があります。</font><br>\r\n<br>\r\nRELEASEコマースでは、安全・安心な取引を実現するため、商品を購入する前に、事前にポイントを購入いただき、ポイントで決済を行うエスクロー決済を導入しております。<br>\r\nこれにより、配送ボタンを出品者と購入者がそれぞれクリックして初めて取引が完了する仕組みを採用しております。<br>\r\n<br>\r\nポイントをお持ちでない場合は【ポイントを購入する】ボタンを押して、ポイント購入画面へ進みます。\r\n </p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/buy_img4.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 mb10 f14 strong\">5．ポイントを購入</h4>\r\n<p class=\"ml30 spml_0 mb20\">ポイント決済用のポイントは銀行振り込みにて決済を行います。<br>\r\n※クレジットカード決済は準備中。<br>\r\n購入ポイント数と決済方法を選択し、【ポイントを購入する】ボタンを押しますと、ポイント購入の決済完了メールが自動配信されます。<br>\r\nメール内にお振込み口座が書かれておりますので、お振り込みをいただくと、即日～翌日営業日で決済申請を確認し、ご入金が確定されますとポイントが反映されます。</p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/buy_img5.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">6．商品をポイント決済</h4>\r\n<p class=\"ml30 spml_0 mb20\">事前に購入したポイントを使用して商品のポイント決済を行います。<br>\r\nご注文のお支払合計金額を確認して下さい。<br>\r\n問題がなければ、「ポイント決済する」をクリックして購入を完了させます。 </p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/buy_img6.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 mb10 f14 strong\">7．購入した商品の確認</h4>\r\n<p class=\"ml30 spml_0 mb20\"><a href=\"https://shop.release.sc/mypage\" target=\"_blank\">マイページ</a>内の【<a href=\"https://shop.release.sc/mypage/purchased\" target=\"_blank\">購入した商品を見る</a>】ページを開くと、購入商品のリストが表示されます。<br>\r\n<br>\r\n購入した商品が出品者によって、事前に会員登録時の住所に発送されます。<br>\r\n商品受け取り後、「ステータス」の部分に「受け取りしました」リンクが表示されますので、受け取りボタンを押して取引完了となります。</p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/buy_img7.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>','0000-00-00 00:00:00','2020-09-21 23:52:50'),(6,5,0,'出品者ガイド','<h4 class=\"ml30 spml_0 mb10 f14 strong\">1．まずは新規会員登録</h4>\r\n<p class=\"ml30 spml_0\">新規会員登録は、必要事項を入力するだけでとても簡単です。<br>\r\n  登録したメールアドレスに届く登録認証メールをクリックし、完了します。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/UUvLz0T.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">2．サイトにログイン</h4>\r\n<p class=\"ml30 spml_0 mb20\">会員登録時に入力した登録情報（メールアドレスとパスワード）を入力し、\r\n  「ログイン」ボタンをクリックして、ログインして下さい。 </p>\r\n<div>\r\n  <img src=\"https://imgur.com/UUvLz0T.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">3．出品したい商品やサービスを登録する</h4>\r\n<p class=\"ml30 spml_0 mb20\">左カラムの「商品を出品する」から商品の登録を開始します。<br>\r\n  出品したい商品名や詳細情報を記入し誓約事項確認をよく確認しチェック入れ出品を完了します。</p>\r\n<div>\r\n  <img src=\"https://imgur.com/UUvLz0T.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">4．商品が購入される</h4>\r\n<p class=\"ml30 spml_0 mb20\">商品が購入された場合、ダウンロード商品はすでに登録済みの場合はそのままでも構いません。<br>\r\n  スキルシェアなどのサービス商品であれば作業を行ないます。<br>\r\n  この場合、購入者とヒアリングを行った上でサービス完了を目指してください。</p>\r\n<div>\r\n  <img src=\"https://imgur.com/UUvLz0T.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">5．換金申請の準備をする</h4>\r\n<p class=\"ml30 spml_0 mb20\">「マイページ」の「登録情報」から会員登録内容を変更します。<br>\r\n  振込先口座情報を記入し換金申請へ進みます。</p>\r\n<div>\r\n  <img src=\"https://imgur.com/UUvLz0T.png\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">6．換金申請をする</h4>\r\n<p class=\"ml30 spml_0 mb20\">「マイページ」の「売上管理」から換金申請を行います。<br>\r\n  売り上げ金額が「換金申請できる金額」に到達している場合、換金申請が行えます。</p>\r\n<div>\r\n  <img src=\"https://imgur.com/UUvLz0T.png\" alt=\"\" class=\"guide_img\">\r\n</div>','<h4 class=\"ml30 spml_0 mb10 f14 strong\">1．RELEASEコマースへ新規会員登録</h4>\r\n<p class=\"ml30 spml_0\"><a href=\"https://shop.release.sc/member_regist\" target=\"_blank\"><u>新規会員登録</u></a>は、会員利用規約に同意後、必要事項を入力し登録を確定します。<br>\r\n  登録確定後、登録したメールアドレスに届く新規登録完了メール内の「認証用URL」をクリックし、完了します。 </p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/sale_img1.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">2．サイトにログイン</h4>\r\n<p class=\"ml30 spml_0 mb20\"><a href=\"https://shop.release.sc/mypage/login\" target=\"_blank\"><u>ログインページ</u></a>にて、会員登録時に入力した登録情報（メールアドレスとパスワード）を入力し、\r\n  「ログイン」ボタンをクリックして、ログインして下さい。 </p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/sale_img2.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">3．商品を出品（登録）する</h4>\r\n<p class=\"ml30 spml_0 mb20\">ログイン後、画面右下の【<a href=\"https://shop.release.sc/mypage/item\" target=\"_blank\">出品する</a>】ボタンを押して出品を開始します。\r\n出品する商品の画像、商品名、商品の詳細情報等を入力し、誓約事項を確認し、出品を完了します。</p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/sale_img3.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">4．商品が購入される</h4>\r\n<p class=\"ml30 spml_0 mb20\">商品が購入された場合、<a href=\"https://shop.release.sc/mypage\" target=\"_blank\">マイページ</a>内の【<a href=\"https://shop.release.sc/mypage/process_order\" target=\"_blank\" target=\"_blank\">注文を処理する</a>】をクリックし、注文内容を確認、商品の購入者名をクリックして【メッセージを送る】より、購入者に購入のお礼と配送に必要な情報（住所や電話番号等）を確認するメッセージを送信してやり取りを行い、商品を発送します。<br><br>商品の発送が完了しましたら、【<a href=\"https://shop.release.sc/mypage/process_order\" target=\"_blank\" target=\"_blank\">注文処理</a>】ページの「発送しました」リンクを必ず押してください。<br>\r\n<br>\r\n商品が届き次第、購入者から「受け取りました」リンクを押されると取引が成立します</p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/sale_img4.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">5．振込先口座～換金申請</h4>\r\n<p class=\"ml30 spml_0 mb20\">購入者との取引が完了すると、販売手数料を引いたポイントがマイページに反映されます。<br>\r\n<br>\r\n※【<a href=\"https://shop.release.sc/mypage/cashing\" target=\"_blank\">換金申請</a>】前には、必ず【<a href=\"https://shop.release.sc/mypage/profile\" target=\"_blank\">登録情報変更</a>】にて、売上金の振込先口座情報が入力済みか確認をしてください。<br>\r\n<br>\r\n売り上げ金額が換金申請可能額を超えている場合、<a href=\"https://shop.release.sc/mypage\" target=\"_blank\">マイページ</a>の「売上管理」から【<a href=\"https://shop.release.sc/mypage/cashing\" target=\"_blank\">換金申請</a>】が可能となります。</p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/sale_img5.jpg\" alt=\"\" class=\"guide_img\">\r\n</div>\r\n<h4 class=\"ml30 spml_0 f14 strong\">6．換金申請</h4>\r\n<p class=\"ml30 spml_0 mb20\">売り上げ金額が「換金申請可能額」を超えている場合、換金申請が行えます。<br>出金申請日を各月10日、20日、末日として、振り込み申請締め日から次回の振り込み申請締め日（金融機関休業日の場合は翌営業日）に出金手数料（330円）を差し引いた金額を出品者が管理画面にて登録した金融機関口座に振り込むものとします。<br>\r\n（例）10月1日～10日の振り込み申請の場合、10月20日に売上金振り込み<br>\r\n（例）10月11日～20日の振り込み申請の場合、10月31日（末日）に売上金振り込み<br>\r\n（例）10月21日～31日の振り込み申請の場合、11月10日に売上金振り込み</p>\r\n<div>\r\n  <img src=\"https://shop.release.sc/kimonon/img/sale_img6.jpg\"></div>','0000-00-00 00:00:00','2020-09-26 18:19:45'),(7,6,0,'よくある質問','<div id=\"sub\" class=\"col-xs-12 col-sm-12 col-md-12 m60\">\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n  <p class=\"title\">Q. ここに質問が入ります</p>\r\n  <p>A. ここにアンサーが入ります。</p>\r\n</div>','<div id=\"sub\" class=\"col-xs-12 col-sm-12 col-md-12 m60\">\r\n  <p class=\"title\">Q. 出品中の商品はいつまで買えますか？</p>\r\n  <p>A. 購入されるまで掲載され、出品者が非公開にしない限り購入可能です。</p>\r\n  <p class=\"title\">Q. 現在取引している商品をキャンセルしたいのですがどうしたらいいですか？</p>\r\n  <p>A. 一度、購入されたものは商品の性質上、基本的にはキャンセルができません。<br>やむを得ない事情の場合は、一度運営事務局に<a href=\"http://release.co.jp/contact/\" target=\"_blank\"><u>お問い合わせ</u></a>ください。</p>\r\n  <p class=\"title\">Q. 商品が売れた際の販売手数料はいくらでしょうか？</p>\r\n  <p>A. 販売金額の8％が販売手数料となっております。</p>\r\n  <p class=\"title\">Q. 売上金はいつ振り込まれますか？</p>\r\n  <p>A. 売上金額が換金申請可能額を超えた場合、出金申請を管理画面より行うことができます。<br>\r\n出金申請日を各月10日、20日、末日として、振り込み申請締め日から次回の振り込み申請締め日（金融機関休業日の場合は翌営業日）に出金手数料（330円）を差し引いた金額を出品者が管理画面にて登録した金融機関口座に振り込まれます。<br>\r\n（例）10月1日～10日の振り込み申請の場合、10月20日に売上金振り込み<br>\r\n（例）10月11日～20日の振り込み申請の場合、10月31日（末日）に売上金振り込み<br>\r\n（例）10月21日～31日の振り込み申請の場合、11月10日に売上金振り込み</p>\r\n  <p class=\"title\">Q. 誤った口座を入力して換金申請をしてしまいました、どうしたらいいですか？</p>\r\n  <p>A. 運営事務局で確認しますので、一度<a href=\"http://release.co.jp/contact/\" target=\"_blank\"><u>お問い合わせ</u></a>ください。</p>\r\n  <p class=\"title\">Q. 退会後の個人情報はどうなりますか？</p>\r\n  <p>A. 運営事務局で、適宜データを削除しておりますのでご安心ください。</p>\r\n  <p class=\"title\">Q. 利用するにあたってかかる費用はありますか？</p>\r\n  <p>A. 商品を買うまで、商品が売れるまでは、費用は一切必要ございません。<br>\r\n　商品が売れた場合にのみ販売手数料を引いた額がポイントとして支給されますので、換金申請を行い、現金化をしてください。</p>\r\n</div>','0000-00-00 00:00:00','2020-09-27 00:25:33'),(9,8,0,'特定商法取引に基づく表記','<p class=\"title\">運営サービス</p>\r\n<p>Mallento デモサイト</p>\r\n\r\n<p class=\"title\">運営統括サービス</p>\r\n<p>Mallento デモサイト</p>\r\n\r\n<p class=\"title\">所在地</p>\r\n<p>ここに住所を入れる</p>\r\n\r\n<p class=\"title\">URL</p>\r\n<p>http://demo.mallento.com</p>\r\n\r\n<p class=\"title\">メールアドレス</p>\r\n<p>ここにメールアドレスを入れる</p>\r\n\r\n<p class=\"title\">返品・キャンセル等</p>\r\n<p>サービスの性質上、返品・返金はお受けしておりません。</p>\r\n\r\n<p class=\"title\">商品の価格</p>\r\n<p>商品ごとに表示された税込み価格に基づく。</p>\r\n\r\n<p class=\"title\">商品代金以外の必要金額</p>\r\n<p>銀行振込手数料、通信料、出品者のみ事務手数料</p>\r\n\r\n<p class=\"title\">ご注文方法</p>\r\n<p>オンラインでのみとさせていただきます。</p>\r\n\r\n<p class=\"title\">お支払い方法</p>\r\n<p>銀行振込、クレジットカード決済<br>\r\n銀行振込をご希望のお客様は着金後、即日〜2、3日営業日で反映されます。</p>\r\n\r\n<p class=\"title\">引渡し時期</p>\r\n<p>ご入金確認後、クレジットの場合はシステムにより即時ポイント反映します。<br>\r\n(ポイントがアカウントに反映された時点で、ポイント購入対象商品をポイント決済後、すぐにご利用が可能です)<br>\r\nダウンロード可能期間は、購入したその日を含む7日間です。<br>\r\nスキル商品はポイント決済が完了した時点で着手可能となります。<br>\r\n7日間を過ぎますとダウンロードはできませんので、お早めにダウンロードをお願いします。<br>\r\n尚、ポイントの有効期限は無期限です。</p>\r\n\r\n<p class=\"title\">お問い合わせ</p>\r\n<p>メールアドレスでお問い合わせください。</p>','<p class=\"title\">運営サービス</p>\r\n<p>RELEASE コマース</p>\r\n\r\n<p class=\"title\">運営会社</p>\r\n<p>株式会社スマイルホールディングス</p>\r\n\r\n<p class=\"title\">所在地</p>\r\n<p>福岡県福岡市中央区薬院1-11-14-6F</p>\r\n\r\n<p class=\"title\">URL</p>\r\n<p>https://shop.release.sc/</p>\r\n\r\n<p class=\"title\">メールアドレス</p>\r\n<p><a href=\"m&#97;i&#108;t&#111;:&#105;&#110;&#102;&#111;&#64;&#114;&#101;&#108;ea&#115;&#101;&#46;&#99;&#111;&#46;&#106;p\">&#105;&#110;&#102;&#111;&#64;&#114;&#101;&#108;ea&#115;&#101;&#46;&#99;&#111;&#46;&#106;p</a>\r\n</p>\r\n\r\n<p class=\"title\">返品・キャンセル等</p>\r\n<p>サービスの性質上、返品・返金は原則お受けしておりません。</p>\r\n\r\n<p class=\"title\">商品の価格</p>\r\n<p>商品ごとに表示された税込み価格に基づく。</p>\r\n\r\n<p class=\"title\">商品代金以外の必要金額</p>\r\n<p>銀行振込手数料、通信料、出品者のみ事務手数料</p>\r\n\r\n<p class=\"title\">ご注文方法</p>\r\n<p>オンラインでのみとさせていただきます。</p>\r\n\r\n<p class=\"title\">お支払い方法</p>\r\n<p>銀行振込<br>\r\n銀行振込をご希望のお客様は着金後、即日～2、3日営業日で反映されます。<br>※クレジットカード決済は準備中。</p>\r\n\r\n<p class=\"title\">ポイント引渡し時期</p>\r\n<p>ご入金確認後、銀行振込の場合は着金後、即日～2、3日営業日で反映されます。<br>\r\n(ポイントがアカウントに反映された時点で、商品をポイント決済後、商品の購入が可能です)<br>\r\nポイント決済が完了した時点で着手、DM連絡が可能となります。<br>\r\n尚、ポイントの有効期限は無期限です。</p>\r\n<!--<p>ご入金確認後、クレジットの場合はシステムにより即時ポイント反映します。<br>\r\n(ポイントがアカウントに反映された時点で、商品をポイント決済後、すぐにご利用が可能です)<br>\r\nポイント決済が完了した時点で着手、DM連絡が可能となります。<br>\r\n尚、ポイントの有効期限は無期限です。</p>-->\r\n\r\n<p class=\"title\">お問い合わせ</p>\r\n<p><a href=\"http://release.co.jp/contact/\" target=\"_blank\">お問い合わせフォーム</a></p>','0000-00-00 00:00:00','2020-09-27 00:22:49'),(10,9,0,'個人情報保護について','<div class=\"mt20 ml20 pl20 spml_0 sppl_0\">\r\n  <p class=\"f14 mt10\">Mallento デモサイトでは個人情報の重要性を確認し、以下の取り組みを実施いたしており</p>\r\n  <p>(1) Mallento デモサイトでは、お客様個人に関する情報（以下「個人情報」といいます。」を館</p>\r\n  <p>(2) ユーザーの皆様から個人情報を取得させていただく場合は、利用目的をできる限り</p>\r\n  <p>(3) Mallento デモサイトでは、お客様より取得させていただいた個人情報を適切に管理し、以 </p>\r\n  <p class=\"ml15\">(a)「※この商品を購入すると、ダウンロード会員の氏名がアップロード会員に開示</p>\r\n  <p class=\"ml15\">(b)「※この商品を購入すると、ダウンロード会員のEメールアドレスがアップロー </p>\r\n  <p class=\"ml15\">(c) 商品の購入後、ダウンロード会員の意思で、該商品のアップロード会員にダウン...</p>\r\n  <p class=\"ml15\">※ 利用規約文章は管理画面のページ・CSS編集より編集いただけます。</p>\r\n</div>','<div class=\"mt20 ml20 spml_0 sppl_0\">\r\n  <p>RELEASE コマース（以下：当サイト）における個人情報の取得は、当サイトで提供する<br>\r\nサービスの充実ならびに円滑な提供(提携事業者によるサービスの提供を含む)および<br>\r\n当サイトの円滑な運営を目的としその目的の達成に必要な範囲内で行います。</p>\r\n  <p>取得した個人情報は取得目的の範囲内で利用し、これらの目的以外で利用する場合には<br>\r\n　利用者に対し事前に確認、または同意を求めます。</p>\r\n  <p>個人情報の取得は当サイト上での入力により取得を行います。<br>\r\n　当サイト上での個人情報の取得にあたっては、登録時の確認アイコン等へのクリックによって<br>\r\n　ユーザー本人の同意を得たものとします。</p>\r\n\r\n  <p>当サイトでは、次のいずれかに該当する場合を除き、個人情報を第三者の開示・提供いたしません。</p>\r\n  <p class=\"ml15\">〇ご本人の同意がある場合</p>\r\n  <p class=\"ml15\">〇人の生命・身体または財産の保護のために必要な場合で当て、緊急を要するなど<br>\r\n　　ご本人の同意を得ることが困難である場合。</p>\r\n  <p class=\"ml15\">〇国の機関もしくは地方公共団体またはその委託を受けた者が<br>\r\n　　法令の定める事務を遂行することに対して協力する必要がある場合であって<br>\r\n　　ご本人の同意を得ることにより当該事務の遂行に支障を及ぼす恐れがある場合。</p>\r\n  <p class=\"ml15\">〇事業の継承に伴って、個人情報を提供する場合</p>\r\n  <p class=\"ml15\">〇利用目的の達成に必要な範囲内において、業務委託先に開示または提供する場合<br>\r\n　　※この場合は、個人情報の取り扱いに関する契約の締結等により<br>\r\n　　　当該業務委託先において個人情報の適切な取り扱いが確保されるよう<br>\r\n　　　必要かつ適切な監督を行います。</p>\r\n  <p class=\"ml15\">〇その他、法令等に基づき第三者に対する開示または提供が許される場合</p>\r\n</div>','0000-00-00 00:00:00','2020-10-15 15:23:48'),(11,10,0,'運営会社','<p class=\"title\">運営会社</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">運営統括責任者</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">所在地</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">販売価格</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">お支払い方法</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">お届け方法</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">お届け期間</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">有効期限</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">商品の返品</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">メールアドレス※</p>\r\n<p>テキストが入ります</p>\r\n<p class=\"title\">電話番号</p>\r\n<p>テキストが入ります</p>','<p class=\"title\">購入・出品について</p>\r\n<p><a href=\"https://shop.release.sc/aboutus/guide/buy\">購入者ガイド</a></p>\r\n<p><a href=\"https://shop.release.sc/aboutus/guide/sale\">出品者ガイド</a></p>\r\n<p><a href=\"https://shop.release.sc/aboutus/faq\">よくある質問</a></p>\r\n\r\n<p class=\"title\">運営・利用規約等</p>\r\n<p><a href=\"https://shop.release.sc/aboutus/law\">特定商法取引に基づく表記</a></p>\r\n<p><a href=\"https://shop.release.sc/commerce-terms/\">利用規約</a></p>\r\n<p><a href=\"https://shop.release.sc/aboutus/privacy\">個人情報保護について</a></p>\r\n<p><a href=\"https://release.co.jp/contact/\">お問い合わせ</a></p>','0000-00-00 00:00:00','2020-10-15 13:17:59'),(12,11,0,'お問い合わせ','<p class=\"title\">運営サービス</p>\r\n<p>Mallento デモサイト</p>\r\n\r\n<p class=\"title\">運営統括サービス</p>\r\n<p>Mallento デモサイト</p>\r\n\r\n<p class=\"title\">所在地</p>\r\n<p>ここに住所が入ります。</p>\r\n\r\n<p class=\"title\">URL</p>\r\n<p>http://minnagaka.site</p>\r\n\r\n<p class=\"title\">メールアドレス</p>\r\n<p>ここにメールアドレスが入ります。</p>\r\n\r\n<p class=\"title\">返品・キャンセル等</p>\r\n<p>サービスの性質上、返品・返金はお受けしておりません。</p>\r\n\r\n<p class=\"title\">商品の価格</p>\r\n<p>商品ごとに表示された税込み価格に基づく。</p>\r\n\r\n<p class=\"title\">商品代金以外の必要金額</p>\r\n<p>銀行振込手数料、通信料、出品者のみ事務手数料</p>\r\n\r\n<p class=\"title\">ご注文方法</p>\r\n<p>オンラインでのみとさせていただきます。</p>\r\n\r\n<p class=\"title\">お支払い方法</p>\r\n<p>銀行振込、クレジットカード決済<br>\r\n銀行振込をご希望のお客様は着金後、即日〜2、3日営業日で反映されます。</p>\r\n\r\n<p class=\"title\">引渡し時期</p>\r\n<p>ご入金確認後、クレジットの場合はシステムにより即時ポイント反映します。<br>\r\n(ポイントがアカウントに反映された時点で、ポイント購入対象商品をポイント決済後、すぐにご利用が可能です)<br>\r\nダウンロード可能期間は、購入したその日を含む7日間です。<br>\r\nスキル商品はポイント決済が完了した時点で着手可能となります。<br>\r\n7日間を過ぎますとダウンロードはできませんので、お早めにダウンロードをお願いします。<br>\r\n尚、ポイントの有効期限は無期限です。</p>\r\n\r\n<p class=\"title\">お問い合わせ</p>\r\n<p>メールアドレスでお問い合わせください。</p>','<p class=\"title\">運営サービス</p>\r\n<p>RELEASE コマース</p>\r\n\r\n<p class=\"title\">運営会社</p>\r\n<p>株式会社スマイルホールディングス</p>\r\n\r\n<p class=\"title\">所在地</p>\r\n<p>福岡県福岡市中央区薬院1-11-14-6F</p>\r\n\r\n<p class=\"title\">URL</p>\r\n<p>https://shop.release.sc/</p>\r\n\r\n<p class=\"title\">お問い合わせ</p>\r\n<p><a href=\"https://release.co.jp/contact/\" target=\"_blank\">お問い合わせフォーム</a>\r\n</p>\r\n','0000-00-00 00:00:00','2020-10-06 18:42:02'),(13,12,0,'利用規約','<p>Mallento利用規約</p>\n\n<p>第1条　ユーザーの皆様の利用資格</p>\n<ul>\n<li>1.ユーザーの皆様とは本規約を承認の上、インターネットを使ってMallento（以下、「Mallento」といいます。）が定めるURLにおいて運営するデジタルデータ売買サービス（以下、「本サービス」といいます。）利用のためにユーザーとして入会を申し込み、Mallentoが入会を認めた個人、法人のことを言います。</li>\n<li>2.ユーザーの皆様は、本規約に基づき、本サービスに、デジタルコンテンツ及びサービス（以下、「商品等」といいます。）を出品すること並びに出品された商品等を購入することができます。</li>\n</ul>\n\n<p>第2条　本規約の変更</p>\n<ul>\n<li>Mallentoは、本規約を変更することができるものとします。本規約を変更した場合、料金その他の本サービスに関する一切の事項は変更後の規約によるものとします。</li>\n</ul>\n\n<p>第3条　Mallentoの役割</p>\n<ul>\n<li>1.Mallentoは、本サービスに出品された商品等に関する一切の事項について何らの責任を負いません。</li>\n<li>2.Mallentoは、本サービスにおける出品者、購入者に関する一切の事項について何らの責任を負いません。</li>\n<li>3.Mallentoは、本サービスに関して、出品者、購入者、その他の第三者との間で発生した一切のトラブルについて、関知しません。したがって、これらのトラブルについては、当事者間で話し合い、訴訟などにより解決するものとします。</li>\n</ul>\n\n<p>第4条　サービスのご利用にあたって</p>\n<ul>\n<li>本サービスを利用される方は、本規約を承認の上、Mallentoの所定の手続きにより利用開始されるものとします。</li>\n</ul>\n\n<p>第5条　会員登録について</p>\n<ul>\n<li>ユーザーの皆様は、Mallentoのサイト上の所定のフォームに必要事項を記入しMallentoに送信することで、出品者、購入者として会員に登録することができます。</li>\n<li>出品者、購入者としての会員の登録は別個に行う必要があり、重複して登録することができます。</li>\n<li>会員登録を行う際に記入する必要事項に関しては、真実かつ正確な内容を記載する必要があります。</li>\n<li>ユーザーの皆様はMallentoからのメールを受信できるよう、ご自身で設定する必要があります。また、メールが受信できないことによって生じた損害について、Mallentoは一切保証いたしません。</li>\n<li>ユーザーの皆様が以下の項目に該当する場合は、Mallentoは、ユーザーの皆様に事前の承諾を得ることなく、その会員登録を抹消し、法的処置をとる権利を有しています。</li>\n<li>（1）会員資格を不正に利用した場合</li>\n<li>（2）登録情報に虚偽の事実が認められた場合</li>\n<li>（3）未成年者で保護者の同意を得ていなかったことが発覚した場合</li>\n<li>（4）Mallentoのサービスの信用や社会的地位を脅かすおそれのある行為が発覚した場合</li>\n<li>（5）Mallentoのサービスまたはシステムを不正に利用した場合</li>\n<li>（6）Mallento利用時におけるMallentoまたは第三者への支払いを怠った場合</li>\n<li>（7）過去にMallentoの会員登録抹消処分を受けていたことが発覚した場合</li>\n<li>（8）パスワードの不正使用が行われたと認められる場合</li>\n<li>（9）本規約に違反するおそれ、または明確な違反があるとMallentoが判断した場合</li>\n<li>（10）反社会勢力と取引がある場合、もしくは反社会勢力との取引を示唆した場合</li>\n<li>（11）前各号のほか、Mallentoが会員登録を適当でないと判断した場合</li>\n<li>会員登録を終えたユーザーは、会員登録の際に設定したメールアドレス、パスワードを自分自身で管理する必要があります。設定したメールアドレスおよびパスワードを利用して行われた行為の責任は当該メールアドレスおよびパスワードを保有しているユーザーの責任とみなします。</li>\n<li>万が一、許可なく自分のメールアドレスおよびパスワードが利用された場合、またはメールアドレスおよびパスワードが第三者に漏洩してしまった場合にはただちにパスワードを変更してください。Mallentoは、メールアドレスおよびパスワードの漏洩、不正使用などから生じた損害については一切保証いたしません。</li>\n<li>ユーザーが退会を希望する場合、所定のフォームからMallentoに連絡をするものとします。それを受けて、Mallentoが退会処理を行います。</li>\n<li>ダウンロード会員を退会した場合、これまでに購入した商品を再ダウンロードすることはできません。</li>\n</ul>\n\n<p>第6条　出品</p>\n<ul>\n<li>1.出品者は、Mallento所定の方式により出品を行うものとします。</li>\n<li>2.出品者は、出品を取り消すことができます。</li>\n<li>3.以下の商品等の出品を禁止します。</li>\n<li>a.覚せい剤、麻薬、向精神薬、大麻、あへん、毒物、劇物</li>\n<li>b.銃砲、刀剣類、武器、火薬類、化学兵器、毒性物質、サリン</li>\n<li>c.わいせつ物、児童ポルノ、アダルトグッズ、アダルトビデオ、アダルトゲーム、ブルセラ</li>\n<li>d.売春、児童売春</li>\n<li>e.賭博、富くじ</li>\n<li>f.無限連鎖講、マルチ商法</li>\n<li>g.偽造された通貨、有価証券、公正証書（免許証、旅券などを含む。）、文書、電磁的記録</li>\n<li>h.窃盗、強盗、詐欺、恐喝、横領、背任その他の犯罪により入手した商品等</li>\n<li>i.特許権、実用新案権、意匠権、商標権、著作権、肖像権その他の他人の権利を侵害する商品等（例　偽ブランド商品、違法コピー商品など）</li>\n<li>j.コンピューターウィルスを含むソフトウェア</li>\n<li>k.医薬品</li>\n<li>l.人体及び人体の一部</li>\n<li>m.個人情報、営業秘密その他一般に公開されていない情報</li>\n<li>o.商品等の販売・提供に免許、登録、届出等が法律上必要なもの（但し、Mallentoが特別に認めた場合を除く。）</li>\n<li>p.生物</li>\n<li>q.犯罪その他の法令違反行為</li>\n<li>r.その他取引することが法令に違反する商品等</li>\n<li>s.その他Mallentoが不適当と判断した商品等</li>\n<li>4.出品者は、出品した商品等の内容及び販売・提供条件について、文字及び画像により具体的かつ適切な説明を行うものとします。</li>\n<li>5.出品者は、出品した商品等についての説明が真実であることを保証するものとします。</li>\n<li>6.出品者が事業者である場合、出品に際して、特定商取引に関する法律、不当景品類及び不当表示防止法その他関係法令及び監督官庁の指示・指導を遵守するものとします。</li>\n<li>7.出品者が古物商である場合、出品に際して、古物営業法の規定を遵守するものとします。</li>\n<li>8.未成年者がご出品頂く場合、保護者又は親権者の同意を得なければいけません。</li>\n<li>9.出品者が本規約に違反した出品を行った場合、出品者が真に売買契約等を締結する意思のない出品を行ったとMallentoが判断した場合、その他Mallentoが不適当と認める場合、Mallentoは出品を無効とすることができるものとします。出品が無効となった場合、当該出品に対する購入もすべて無効とします。</li>\n</ul>\n\n<p>第7条　料金の支払方法</p>\n<ul>\n<li>1.料金の支払いに関して本サービス上においては、本サービスに必要な費用に代わる単位として「Mallentoポイント」を設けております。この Mallentoポイント は本サービス内で商品等と交換できる有償で提供される仮想通貨です。MallentoポイントはMallentoサイト内でのみ使用でき、購入者は、あらかじめMallentoポイント を購入することによって、本サービスを利用することができます。</li>\n<li>2.Mallentoポイントは以下の条件で購入することができます。</li>\n<li>(1)　本サービスを使用しているユーザーのみMallentoポイント を購入することができます。</li>\n<li>(2)　Mallentoポイントは、Mallentoが別途定める各単位で購入することができます。</li>\n<li>(3)　Mallentoポイントを購入するユーザーが未成年（20歳未満）の場合は、保護者または親権者が同意の上、購入するものとします。</li>\n<li>(4)　本サービスを削除するとMallentoポイント は消滅するものとし、端末を変更するとMallentoポイント を引き継ぐことはできないものとします。</li>\n<li>(5)　Mallentoポイント の購入に関する決済方法については、Mallentoが別に定める方法によるものとします。</li>\n<li>(6)　Mallentoは、Mallentoポイント によって行われた代金決済について領収書等は発行いたしません。</li>\n<li>Mallentoポイント は以下の条件で使用することができます。</li>\n<li>(1)　オーブはMallento所定の方法で使用することができます。</li>\n<li>(2)　交換するコンテンツの必要Mallentoポイント数はそれぞれ別に定めるものとします。</li>\n<li>(3)　Mallentoは、法律で定める場合を除き、いかなる理由であってもMallentoポイント の払い戻し等は一切行わないものとします。</li>\n<li>(4)　Mallentoポイント を換金することまたはコンテンツ以外の財・サービスに交換することはMallentoが別途認める場合を除きできません。</li>\n<li>3.Mallentoサイトで成立した売買に係るMallentoポイントの徴収は、出品者に代わってMallentoが行います。</li>\n</ul>\n\n<p>第8条　使用料金等</p>\n<ul>\n<li>1.本サービスの使用は原則として無料とします。</li>\n<li>2.Mallentoが、本サービスの使用の対価を求める場合にはユーザーに事前に通知し同意を得るものとします。</li>\n</ul>\n\n<p>第9条　購入</p>\n<ul>\n<li>1.購入者は、Mallento所定の方式により購入を行うものとします。</li>\n<li>2.購入者は、Mallentoが別途定める金額の決済代行手数料をMallentoに対して支払わなければならないものとします。</li>\n<li>3.未成年者がご出品頂く場合、保護者又は親権者の同意を得なければいけません。 </li>\n</ul>\n\n<p>第10条　本規約の違反等について</p>\n<ul>\n<li>1.ユーザーの皆様が以下の各号のいずれかに該当した場合、Mallentoは、Mallentoの定める期間、出品又は購入その他の機能の利用を認めないこと、又は、本サービスを利用する資格を取り消すことができるものとします。</li>\n<li>a.規約に違反した場合</li>\n<li>b.ユーザーの皆様が真に売買契約を締結する意思のない出品あるいは購入を行ったとMallentoが判断した場合</li>\n<li>c.他の利用者または第三者に不当に迷惑をかけたとMallentoが判断した場合</li>\n<li>2.Mallentoの措置によりユーザーの皆様に損害が生じても、Mallentoは、一切損害を賠償しません。</li>\n</ul>\n\n<p>第11条　サービスの提供条件</p>\n<ul>\n<li>1.Mallentoは、メンテナンス等のために、ユーザーの皆様に通知することなく、本サービスを停止し、又は変更することがあります。</li>\n<li>2.本サービスの提供を受けるために必要な機器、通信手段などは、ユーザーの皆様の費用と責任で備えるものとします。</li>\n<li>3.Mallentoは、本サービスに中断、中止その他の障害が生じないことを保証しません。</li>\n</ul>\n\n<p>第12条　売上のお支払いについて</p>\n<ul>\n<li>1.Mallentoは出品者の方に対してMallentoサイトにて購入された商品の売上金額をお支払いするものとします。</li>\n<li>2.売上は毎月末日締めで翌月末日にご指定の口座にお振込み致します。ただし、末日が金融機関の休日にあたる場合は翌営業日とします。また、各金融機関所定の振込手数料はユーザ様負担とします。</li>\n<li>3.銀行振込には口座の登録が必要となります。ユーザ様がお支払い口座を正しく指定しない場合、Mallentoは、未払報酬を支払わないことができるものとします。</li>\n<li>4.当月の売上が支払い金額(20,000円以上)に達しない場合は売上は翌月に繰越されます。</li>\n繰越された売上の累計売上が20,000円に達した月がお支払い対象月となります。</li>\n\n<li>5.売上支払対象となる本件取引の有無及び金額については、Mallentoが決定するものとします。なおMallentoは、第9条における違反行為に該当する行為が含まれる場合、またはそのおそれがある場合、売上支払いの全部または一部の支払いを留保することができるものとします</li>\n<li>6.最後に売上が発生した日から１年以内に未払売上の累計額がMallentoの定める金額を超えない場合、及び本規約が解除された時に未払売上の累計額がMallentoの定める金額を超えていない場合には、未払報酬の請求権は消滅するものとします。いったん未払報酬の請求権が消滅した場合、その後に、報酬が発生しても、消滅した未払報酬の請求権は、復活しないものとします。</li>\n</ul>\n\n<p>第13条　著作権について</p>\n<ul>\n<li>1.本サービスを利用して出品されたデジタルコンテンツの著作権は出品者に帰属します。</li>\n<li>2.Mallentoは、出品者が出品したデジタルコンテンツ及び情報を本サービスの円滑な提供、Mallentoシステムの構築、改良、メンテナンスに必要な範囲内で、使用及び改変することができるものとします。</li>\n<li>3.出品者は購入者に対して購入後の私的使用の範囲にて著作権の許諾を了承するとする。</li>\n<li>4.購入者は出品者の了承無しに当サイトにて購入した商品の複製、加工、公衆送信、頒布、販売、公表、2次的著作物の作成、またはそれに準ずる出品者及びMallentoの権利を侵害する行為を禁止します。</li>\n</ul>\n\n<p>第14条　Mallentoの責任</p>\n<ul>\n<li>1.Mallentoは、本サービスに出品された商品等に関する一切の事項について何らの責任を負いません。</li>\n<li>2.Mallentoは、本サービスにおける出品者、購入者に関する一切の事項について何らの責任を負いません。</li>\n<li>3.ユーザーの皆様は法律の範囲内で本サービスをご利用ください。本サービスの利用に関連してユーザーの皆様が日本及び外国の法律に触れた場合でも、Mallentoは一切責任を負いません。</li>\n</ul>\n\n<p>第15条　サービス廃止</p>\n<ul>\n<li>1.MallentoはMallentoの都合によりいつでも本サービスを廃止できるものとします。</li>\n<li>2.Mallentoは、ユーザーの皆様が利用を中止およびアクセス禁止処分になった場合でも一度支払いを受けた料金を返還しません。</li>\n</ul>\n\n<p>第16条 本利用規約および本サービス付随規約の有効性</p>\n<ul>\n<li>1.本利用規約、本サービス付随規約の一部の規定が法令に基づいて無効と判断されても、当該条項の当該部分以外及び本利用規約および本サービス付随規約のその他の規定は有効とします。</li>\n<li>2.本利用規約および本サービス付随規約の規定の一部が、あるユーザーとの関係で無効とされ、または取り消された場合でも、当該一部はその他のユーザーの皆様との関係では有効とします。</li>\n</ul>\n\n<p>第１7条　完全合意</p>\n<ul>\n<li>本規約は、本規約に含まれる事項に関する本規約の当事者間の完全な合意を構成し、口頭又は書面を問わず、本規約に含まれる事項に関する当事者間の事前の合意、表明及び了解に優先します。</li>\n</ul>\n\n<p>第１8条　分離可能性</p>\n<ul>\n<li>本規約のいずれかの条項又はその一部が無効又は失効不能と判断された場合であっても、本規約の残りの規定及び一部が無効又は執行不能と判断された規定の残りの部分は、継続して完全に効力を有するものとします。</li>\n</ul>\n\n<p>第19条　準拠法及び管轄裁判所</p>\n<ul>\n<li>本サービスその他本規約に関する準拠法は日本法とします。ユーザーの皆様とMallentoとの間で訴訟が生じた場合、大阪地方裁判所を専属的管轄裁判所とします。</li>\n</ul>\n\n<p>第20条　協議解決</p>\n<ul>\n<li>Mallento及びユーザーは、本規約に定めない事項又は本規約の解釈の疑義が生じた場合には、互いに信義誠実の原則に従って協議の上速やかに解決を図るものとします。</li>\n</ul>','<p>RELEASE コマース利用規約</p>\r\n\r\n<p>第1条　ユーザーの皆様の利用資格</p>\r\n<ul>\r\n<li>1.ユーザーの皆様とは本規約を承認の上、インターネットを使ってRELEASE コマース（以下、「RELEASE コマース」といいます。）が定めるURLにおいて運営するオンラインマーケットサービス（以下、「本サービス」といいます。）利用のためにユーザーとして入会を申し込み、RELEASE コマースが入会を認めた個人、法人のことを言います。</li>\r\n<li>2.ユーザーの皆様は、本規約に基づき、本サービスに、サービス（以下、「商品等」といいます。）を出品すること並びに出品された商品等を購入することができます。</li>\r\n</ul>\r\n\r\n<p>第2条　本規約の変更</p>\r\n<ul>\r\n<li>RELEASE コマースは、本規約を変更することができるものとします。本規約を変更した場合、料金その他の本サービスに関する一切の事項は変更後の規約によるものとします。</li>\r\n</ul>\r\n\r\n<p>第3条　RELEASE コマースの役割</p>\r\n<ul>\r\n<li>1.RELEASE コマースは、本サービスに出品された商品等に関する一切の事項について何らの責任を負いません。</li>\r\n<li>2.RELEASE コマースは、本サービスにおける出品者、購入者に関する一切の事項について何らの責任を負いません。</li>\r\n<li>3.RELEASE コマースは、本サービスに関して、出品者、購入者、その他の第三者との間で発生した一切のトラブルについて、関知しません。したがって、これらのトラブルについては、当事者間で話し合い、訴訟などにより解決するものとします。</li>\r\n</ul>\r\n\r\n<p>第4条　サービスのご利用にあたって</p>\r\n<ul>\r\n<li>本サービスを利用される方は、本規約を承認の上、RELEASE コマースの所定の手続きにより利用開始されるものとします。</li>\r\n</ul>\r\n\r\n<p>第5条　会員登録について</p>\r\n<ul>\r\n<li>ユーザーの皆様は、RELEASE コマースのサイト上の所定のフォームに必要事項を記入しRELEASE コマースに送信することで、出品者、購入者として会員に登録することができます。</li>\r\n<li>会員登録を行う際に記入する必要事項に関しては、真実かつ正確な内容を記載する必要があります。</li>\r\n<li>ユーザーの皆様はRELEASE コマースからのメールを受信できるよう、ご自身で設定する必要があります。また、メールが受信できないことによって生じた損害について、RELEASE コマースは一切保証いたしません。</li>\r\n<li>ユーザーの皆様が以下の項目に該当する場合は、RELEASE コマースは、ユーザーの皆様に事前の承諾を得ることなく、その会員登録を抹消し、法的処置をとる権利を有しています。</li>\r\n<li>（1）会員資格を不正に利用した場合</li>\r\n<li>（2）登録情報に虚偽の事実が認められた場合</li>\r\n<li>（3）未成年者で保護者の同意を得ていなかったことが発覚した場合</li>\r\n<li>（4）RELEASE コマースのサービスの信用や社会的地位を脅かすおそれのある行為が発覚した場合</li>\r\n<li>（5）RELEASE コマースのサービスまたはシステムを不正に利用した場合</li>\r\n<li>（6）RELEASE コマース利用時におけるRELEASE コマースまたは第三者への支払いを怠った場合</li>\r\n<li>（7）過去にRELEASE コマースの会員登録抹消処分を受けていたことが発覚した場合</li>\r\n<li>（8）パスワードの不正使用が行われたと認められる場合</li>\r\n<li>（9）本規約に違反するおそれ、または明確な違反があるとRELEASE コマースが判断した場合</li>\r\n<li>（10）反社会勢力と取引がある場合、もしくは反社会勢力との取引を示唆した場合</li>\r\n<li>（11）前各号のほか、RELEASE コマースが会員登録を適当でないと判断した場合</li>\r\n<li>会員登録を終えたユーザーは、会員登録の際に設定したメールアドレス、パスワードを自分自身で管理する必要があります。設定したメールアドレスおよびパスワードを利用して行われた行為の責任は当該メールアドレスおよびパスワードを保有しているユーザーの責任とみなします。</li>\r\n<li>万が一、許可なく自分のメールアドレスおよびパスワードが利用された場合、またはメールアドレスおよびパスワードが第三者に漏洩してしまった場合にはただちにパスワードを変更してください。RELEASE コマースは、メールアドレスおよびパスワードの漏洩、不正使用などから生じた損害については一切保証いたしません。</li>\r\n<li>ユーザーが退会を希望する場合、所定のフォームからRELEASE コマースに連絡をするものとします。それを受けて、RELEASE コマースが退会処理を行います。</li>\r\n</ul>\r\n\r\n<p>第6条　出品</p>\r\n<ul>\r\n<li>1.出品者は、RELEASE コマース所定の方式により出品を行うものとします。</li>\r\n<li>2.出品者は、出品を取り消すことができます。</li>\r\n<li>3.以下の商品等の出品を禁止します。出品禁止商品の出品及び出品禁止商品と思われる出品を行った場合は、予告なく出品機能の停止又は退会処分となります。</li>\r\n<li>a.食品（食材）以外の商品（開封済みの食品、飲料、消費(賞味)期限が切れている又は到着後1週間以内に切れる食品、飲料、保健所許可や営業許可等必要な許可を受けていない食品、飲料、医薬品成分を含む健康食品、飲料等含む）</li>\r\n<li>b.覚せい剤、麻薬、向精神薬、大麻、あへん、毒物、劇物</li>\r\n<li>c.銃砲、刀剣類、武器、火薬類、化学兵器、毒性物質、サリン</li>\r\n<li>d.わいせつ物、児童ポルノ、アダルトグッズ、アダルトビデオ、アダルトゲーム、ブルセラ</li>\r\n<li>e.売春、児童売春</li>\r\n<li>f.賭博、富くじ</li>\r\n<li>g.無限連鎖講、マルチ商法</li>\r\n<li>h.偽造された通貨、有価証券、公正証書（免許証、旅券などを含む。）、文書、電磁的記録</li>\r\n<li>i.窃盗、強盗、詐欺、恐喝、横領、背任その他の犯罪により入手した商品等</li>\r\n<li>j.特許権、実用新案権、意匠権、商標権、著作権、肖像権その他の他人の権利を侵害する商品等（例　偽ブランド商品、違法コピー商品など）</li>\r\n<li>k.コンピューターウィルスを含むソフトウェア</li>\r\n<li>l.医薬品</li>\r\n<li>m.人体及び人体の一部</li>\r\n<li>n.個人情報、営業秘密その他一般に公開されていない情報</li>\r\n<li>o.商品等の販売・提供に免許、登録、届出等が法律上必要なもの（但し、RELEASE コマースが特別に認めた場合を除く。）</li>\r\n<li>p.生物（食品を除く）</li>\r\n<li>q.犯罪その他の法令違反行為</li>\r\n<li>r.その他取引することが法令に違反する商品等</li>\r\n<li>s.その他RELEASE コマースが不適当と判断した商品等</li>\r\n<li>4.出品者は、出品した商品等の内容及び販売・提供条件について、文字及び画像により具体的かつ適切な説明を行うものとします。</li>\r\n<li>5.出品者は、出品した商品等についての説明が真実であることを保証するものとします。</li>\r\n<li>6.出品者が事業者である場合、出品に際して、特定商取引に関する法律、不当景品類及び不当表示防止法その他関係法令及び監督官庁の指示・指導を遵守するものとします。</li>\r\n<li>7.出品者が古物商である場合、出品に際して、古物営業法の規定を遵守するものとします。</li>\r\n<li>8.未成年者がご出品頂く場合、保護者又は親権者の同意を得なければいけません。</li>\r\n<li>9.出品者が本規約に違反した出品を行った場合、出品者が真に売買契約等を締結する意思のない出品を行ったとRELEASE コマースが判断した場合、その他RELEASE コマースが不適当と認める場合、RELEASE コマースは出品を無効とすることができるものとします。出品が無効となった場合、当該出品に対する購入もすべて無効とします。</li>\r\n</ul>\r\n\r\n<p>第7条　料金の支払方法</p>\r\n<ul>\r\n<li>1.料金の支払いに関して本サービス上においては、本サービスに必要な費用に代わる単位として「RELEASE コマースポイント」を設けております。この RELEASE コマースポイント は本サービス内で商品等と交換できる有償で提供されるポイントです。RELEASE コマースポイントはRELEASE コマースサイト内でのみ使用でき、購入者は、あらかじめRELEASE コマースポイント を購入することによって、本サービスを利用することができます。</li>\r\n<li>2.RELEASE コマースポイントは以下の条件で購入することができます。</li>\r\n<li>(1)　本サービスを使用しているユーザーのみRELEASE コマースポイント を購入することができます。</li>\r\n<li>(2)　RELEASE コマースポイントは、RELEASE コマースが別途定める各単位で購入することができます。</li>\r\n<li>(3)　RELEASE コマースポイントを購入するユーザーが未成年（20歳未満）の場合は、保護者または親権者が同意の上、購入するものとします。</li>\r\n<li>(4)　本サービスを削除するとRELEASE コマースポイント は消滅するものとし、端末を変更するとRELEASE コマースポイント を引き継ぐことはできないものとします。</li>\r\n<li>(5)　RELEASE コマースポイント の購入に関する決済方法については、RELEASE コマースが別に定める方法によるものとします。</li>\r\n<li>(6)　RELEASE コマースは、RELEASE コマースポイント によって行われた代金決済について領収書等は発行いたしません。</li>\r\n<li>RELEASE コマースポイント は以下の条件で使用することができます。</li>\r\n<li>(1)　ポイントはRELEASE コマース所定の方法で使用することができます。</li>\r\n<li>(2)　RELEASE コマースは、法律で定める場合を除き、いかなる理由であってもRELEASE コマースポイント の払い戻し等は一切行わないものとします。</li>\r\n<li>(3)　RELEASE コマースポイント を換金することまたはコンテンツ以外の財・サービスに交換することはRELEASE コマースが別途認める場合を除きできません。</li>\r\n<li>3.RELEASE コマースサイトで成立した売買に係るRELEASE コマースポイントの徴収は、出品者に代わってRELEASE コマースが行います。</li>\r\n</ul>\r\n\r\n<p>第8条　使用料金等</p>\r\n<ul>\r\n<li>1.本サービスの使用は原則として無料とします。</li>\r\n<li>2.RELEASE コマースが、本サービスの使用の対価を求める場合にはユーザーに事前に通知し同意を得るものとします。</li>\r\n</ul>\r\n\r\n<p>第9条　購入</p>\r\n<ul>\r\n<li>1.購入者は、RELEASE コマース所定の方式により購入を行うものとします。</li>\r\n<li>2.購入者は、RELEASE コマースが別途定める金額の決済代行手数料をRELEASE コマースに対して支払わなければならないものとします。</li>\r\n<li>3.未成年者がご出品頂く場合、保護者又は親権者の同意を得なければいけません。 </li>\r\n</ul>\r\n\r\n<p>第10条　本規約の違反等について</p>\r\n<ul>\r\n<li>1.ユーザーの皆様が以下の各号のいずれかに該当した場合、RELEASE コマースは、RELEASE コマースの定める期間、出品又は購入その他の機能の利用を認めないこと、又は、本サービスを利用する資格を取り消すことができるものとします。</li>\r\n<li>a.規約に違反した場合</li>\r\n<li>b.ユーザーの皆様が真に売買契約を締結する意思のない出品あるいは購入を行ったとRELEASE コマースが判断した場合</li>\r\n<li>c.他の利用者または第三者に不当に迷惑をかけたとRELEASE コマースが判断した場合</li>\r\n<li>2.RELEASE コマースの措置によりユーザーの皆様に損害が生じても、RELEASE コマースは、一切損害を賠償しません。</li>\r\n</ul>\r\n\r\n<p>第11条　サービスの提供条件</p>\r\n<ul>\r\n<li>1.RELEASE コマースは、メンテナンス等のために、ユーザーの皆様に通知することなく、本サービスを停止し、又は変更することがあります。</li>\r\n<li>2.本サービスの提供を受けるために必要な機器、通信手段などは、ユーザーの皆様の費用と責任で備えるものとします。</li>\r\n<li>3.RELEASE コマースは、本サービスに中断、中止その他の障害が生じないことを保証しません。</li>\r\n</ul>\r\n\r\n<p>第12条　売上のお支払いについて</p>\r\n<ul>\r\n<li>1.手数料<br>\r\n出品者は、当社に対し、出品した商品の売買契約が成立した場合、本サービスの利用料として、売買契約が成立した商品の販売価格8%を乗じた金額を手数料として支払うものとします。手数料は、当社または当社が指定する決済事業者及び収納代行業者が支払額と同額を商品代金から差し引く形で徴収することに予め同意するものとします。</li>\r\n<li>2.出金申請<br>\r\n出品者は、売上金額が3,000円を超えた場合、当該売上金額の出金申請を管理画面より行うことができるものとし、出金申請日を各月10日、20日、末日として、振り込み申請締め日から次回の振り込み申請締め日（金融機関休業日の場合は翌営業日）に出金手数料（330円）を差し引いた金額を出品者が管理画面にて登録した金融機関口座に振り込むものとします。<br>\r\n（例）10月1日～10日の振り込み申請の場合、10月20日に売上金振り込み<br>\r\n（例）10月11日～20日の振り込み申請の場合、10月31日（末日）に売上金振り込み<br>\r\n（例）10月21日～31日の振り込み申請の場合、11月10日に売上金振り込み<br>\r\nまた、本サービスでの最終の売買契約が成立した日から180日を経過した場合、振り込み申請締め日から次回の振り込み申請締め日（金融機関休業日の場合は翌営業日）に出金手数料（330円）を差し引いた金額を出品者が管理画面にて登録した金融機関口座に振り込むものとします。但し、手数料を差し引いた売上金額が当社所定の出金手数料に満たない場合又は管理画面にて振込金融機関口座の登録がない場合は、振り込みは行われません。なお、売上金額の振込は、本サービスに付随する業務として行い、1回の送金限度額は100万円とします。</li>\r\n<li>3.支払留保<br>\r\n売上支払対象となる本件取引の有無及び金額については、RELEASEコマースが決定するものとします。なおRELEASEコマースは、第6条における出品禁止商品の出品等違反行為に該当する行為が含まれる場合、またはそのおそれがある場合、売上支払いの全部または一部の支払いを留保することができるものとします</li>\r\n<li>4.組戻し<br>\r\n出品者が登録した金融機関口座に誤りがあったことにより生じた損害や不利益について、当社は責任を負いません。また、振り込みが宛先口座不明となった場合、当社は、原則として所定の組戻し手数料を振込金額から減算して再振り込みを行います。</li>\r\n</ul>\r\n\r\n<p>第13条　著作権について</p>\r\n<ul>\r\n<li>1.本サービスを利用して出品されたデジタルコンテンツの著作権は出品者に帰属します。</li>\r\n<li>2.RELEASE コマースは、出品者が出品したデジタルコンテンツ及び情報を本サービスの円滑な提供、RELEASE コマースシステムの構築、改良、メンテナンスに必要な範囲内で、使用及び改変することができるものとします。</li>\r\n<li>3.出品者は購入者に対して購入後の私的使用の範囲にて著作権の許諾を了承するとする。</li>\r\n<li>4.購入者は出品者の了承無しに当サイトにて購入した商品の複製、加工、公衆送信、頒布、販売、公表、2次的著作物の作成、またはそれに準ずる出品者及びRELEASE コマースの権利を侵害する行為を禁止します。</li>\r\n</ul>\r\n\r\n<p>第14条　RELEASE コマースの責任</p>\r\n<ul>\r\n<li>1.RELEASE コマースは、本サービスに出品された商品等に関する一切の事項について何らの責任を負いません。</li>\r\n<li>2.RELEASE コマースは、本サービスにおける出品者、購入者に関する一切の事項について何らの責任を負いません。</li>\r\n<li>3.ユーザーの皆様は法律の範囲内で本サービスをご利用ください。本サービスの利用に関連してユーザーの皆様が日本及び外国の法律に触れた場合でも、RELEASE コマースは一切責任を負いません。</li>\r\n</ul>\r\n\r\n<p>第15条　サービス廃止</p>\r\n<ul>\r\n<li>1.RELEASE コマースはRELEASE コマースの都合によりいつでも本サービスを廃止できるものとします。</li>\r\n<li>2.RELEASE コマースは、ユーザーの皆様が利用を中止およびアクセス禁止処分になった場合でも一度支払いを受けた料金を返還しません。</li>\r\n</ul>\r\n\r\n<p>第16条 本利用規約および本サービス付随規約の有効性</p>\r\n<ul>\r\n<li>1.本利用規約、本サービス付随規約の一部の規定が法令に基づいて無効と判断されても、当該条項の当該部分以外及び本利用規約および本サービス付随規約のその他の規定は有効とします。</li>\r\n<li>2.本利用規約および本サービス付随規約の規定の一部が、あるユーザーとの関係で無効とされ、または取り消された場合でも、当該一部はその他のユーザーの皆様との関係では有効とします。</li>\r\n</ul>\r\n\r\n<p>第１7条　完全合意</p>\r\n<ul>\r\n<li>本規約は、本規約に含まれる事項に関する本規約の当事者間の完全な合意を構成し、口頭又は書面を問わず、本規約に含まれる事項に関する当事者間の事前の合意、表明及び了解に優先します。</li>\r\n</ul>\r\n\r\n<p>第１8条　分離可能性</p>\r\n<ul>\r\n<li>本規約のいずれかの条項又はその一部が無効又は失効不能と判断された場合であっても、本規約の残りの規定及び一部が無効又は執行不能と判断された規定の残りの部分は、継続して完全に効力を有するものとします。</li>\r\n</ul>\r\n\r\n<p>第19条　準拠法及び管轄裁判所</p>\r\n<ul>\r\n<li>本サービスその他本規約に関する準拠法は日本法とします。ユーザーの皆様とRELEASE コマースとの間で訴訟が生じた場合、福岡地方裁判所を専属的管轄裁判所とします。</li>\r\n</ul>\r\n\r\n<p>第20条　協議解決</p>\r\n<ul>\r\n<li>RELEASE コマース及びユーザーは、本規約に定めない事項又は本規約の解釈の疑義が生じた場合には、互いに信義誠実の原則に従って協議の上速やかに解決を図るものとします。</li>\r\n</ul>','0000-00-00 00:00:00','2020-09-26 18:13:28');
