ミルキークイーン」、「ヒノヒカリ」のいずれかとなります。品種の指定はできませんのでご了承ください。\r\n\r\n　\r\n■内容量\r\n　 300g\r\n■配送方法 レターパックプラス（全国一律520円）でのお届けになります。','この度は「奥阿蘇くさかべ米」をご購入いただきありがとうございました。','',NULL,NULL,'奥阿蘇米','南阿蘇','高森町','奥阿蘇草部','百年の恵','qeyxTUle8AoVPwt4.jpg','wTMzMbn7RbPExzok.jpg','kAZ6CpwVatVIfDUL.jpg','Z8LuKLPW01fUdWsD.jpg','sHfuTZurPbdi05Iz.jpg',NULL,NULL,NULL,NULL,NULL,1,0,0,0,0,5,'送料込み','普通郵便（定型・定形外）','熊本県','4～7日で発送','12345','レターパックプラスでのお届けになります。\r\n\r\n商品代金はレターパックプラス代金520円を含みます。',0,1,NULL,'2020-09-28 10:36:05','2020-09-28 10:57:20'),(255,136,'高森町　加藤シェフ手作りの生姜ドレッシング　200ｍｌ',1440,NULL,'調味料・ドレッシング類','■ドレッシング\r\n\r\n高森町の旬の野菜を使った創作料理が味わえる\r\nレストラン＆カフェ「Water Forest」、姉妹店「グリル・ド・カトウ」の加藤シェフが作る生姜のドレッシングです。\r\nサラダだけでなく、お肉料理や揚げ物にもピッタリ！\r\n独特の香りと辛みに強い薬効がある生姜。玉ねぎもたっぷり入っています！生姜は玉ねぎと一緒に摂取することで、食欲増進や健康促進に効果があると言われています。\r\n\r\n　\r\n■配送方法 常温配送','ご購入ありがとうございました。','',NULL,NULL,'高森町','手作り','生姜ドレッシング','ドレッシング','','N03gPUWIexAnSP7L.jpg','kn2uZXEwli18QhQY.jpg','N3k9BUogb6qCYQuj.jpg','qUnuH3RxyaiTokBT.jpg','',NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,'着払い(購入者負担)','宅配便','熊本県','4～7日で発送','1234','■ヤマト運輸\r\n注文内容によって送料が異なります。メールにてお知らせいたしますので必ずご確認ください。\r\n\r\n北海道\r\n¥2,100\r\n青森県\r\n¥1,700\r\n岩手県\r\n¥1,700\r\n宮城県\r\n¥1,700\r\n秋田県\r\n¥1,700\r\n山形県\r\n¥1,700\r\n福島県\r\n¥1,700\r\n茨城県\r\n¥1,500\r\n栃木県\r\n¥1,500\r\n群馬県\r\n¥1,500\r\n埼玉県\r\n¥1,500\r\n千葉県\r\n¥1,500\r\n東京都\r\n¥1,500\r\n神奈川県\r\n¥1,500\r\n山梨県\r\n¥1,500\r\n新潟県\r\n¥1,200\r\n富山県\r\n¥1,200\r\n石川県\r\n¥1,200\r\n福井県\r\n¥1,200\r\n長野県\r\n¥1,200\r\n岐阜県\r\n¥1,200\r\n静岡県\r\n¥1,200\r\n愛知県\r\n¥1,200\r\n三重県\r\n¥1,200\r\n滋賀県\r\n¥1,100\r\n京都府\r\n¥1,100\r\n大阪府\r\n¥1,100\r\n兵庫県\r\n¥1,100\r\n奈良県\r\n¥1,100\r\n和歌山県\r\n¥1,100\r\n鳥取県\r\n¥1,100\r\n島根県\r\n¥1,100\r\n岡山県\r\n¥1,100\r\n広島県\r\n¥1,100\r\n山口県\r\n¥1,100\r\n徳島県\r\n¥1,100\r\n香川県\r\n¥1,100\r\n愛媛県\r\n¥1,100\r\n高知県\r\n¥1,100\r\n福岡県\r\n¥1,000\r\n佐賀県\r\n¥1,000\r\n長崎県\r\n¥1,000\r\n熊本県\r\n¥1,000\r\n大分県\r\n¥1,000\r\n宮崎県\r\n¥1,000\r\n鹿児島県\r\n¥1,000\r\n沖縄県\r\n¥1,800\r\n\r\n★着払いの場合、別途、上記の送料金額に、着払い手数料￥330 がプラスされますのでご了承願います。\r\n',0,1,NULL,'2020-09-28 11:09:36'