\r\nお試し価格（送料込）で販売します！\r\n\r\nギフト包装なし・限定10セット限り\r\n\r\n年末には今年の花で花彩ドレッシングが入荷します。\r\nお歳暮やプレゼントにオススメの\r\nこのドレッシングセットをこの機会にぜひ\r\nご家庭でお試しください！\r\n\r\n\r\n■花彩ドレッシング\r\n高森町の北東部、河原・市野尾地区の花農家「Shiraishi Flower Farm」が、丹精込めて育てたお花を使って作ったドレッシングです。見た目も可愛いピンク色で、食卓を華やかに彩ります。サラダはもちろん、お魚のカルパッチョにもオススメ！\r\nドレッシングが作れるのは、花が咲く冬の時期だけ。花卉栽培を行いながらの加工のため、大量生産はできませんが、一本ずつ愛情込めて作っています。\r\n\r\n■生姜ドレッシング\r\n\r\n高森町の旬の野菜を使った創作料理が味わえる\r\nレストラン＆カフェ「Water Forest」、姉妹店「グリル・ド・カトウ」の加藤シェフが作る生姜のドレッシングです。\r\nサラダだけでなく、お肉料理や揚げ物にもピッタリ！\r\n独特の香りと辛みに強い薬効がある生姜。玉ねぎもたっぷり入っています！生姜は玉ねぎと一緒に摂取することで、食欲増進や健康促進に効果があると言われています。\r\n\r\n■配送方法 常温配送\r\n\r\n※関東地方への発送（着払い）の場合、4830円のところ、全国送料・代引手数料込み3500円と大変お得です！\r\n\r\n','お買い上げいただきありがとうございました。\r\nめったにないお試し価格の企画商品です。\r\nどうかご贈答品のお味見としてお召し上がりください。','',NULL,NULL,'お試し価格','花彩ドレッシング','高森町','生姜ドレッシング','限定','JgoPi2Dblsauof6a.jpg','','','','',NULL,NULL,NULL,NULL,NULL,1,0,0,0,0,8,'着払い(購入者負担)','宅配便','熊本県','4～7日で発送','1','',0,1,NULL,'2020-09-28 17:59:22','2020-10-09 09:47:01'),(261,136,'早い者勝ち！　TAKAMORI　BLEND　COFEE　ドリップパックコーヒー　訳あり品',1200,NULL,'お茶・飲料・その他','訳あり品　TAKAMORI BLEND COFFEE　\r\n高森ブレンドコーヒー（Fruity & Mild)　ドリップパック　10袋\r\n\r\nイベント用に大量に仕入れていたドリップパックコーヒーが\r\n賞味期限（2020年10月6日）間近になったため\r\nレターパックプラス送料込で特価でお届けします。\r\n\r\n限定20セット\r\n\r\n１袋に１２ｇ入ってマグカップでもおいしく飲めるドリップパックコーヒーです！\r\n\r\n\r\nTAKAMORI BLENDコーヒーは、ワールドワイド（アジア、中央アメリカ、アフリカ）な産地の違った精製方法で仕上げた豆の特徴を集約し、TAKAMORI BLENDとして融合させました。ベースにコクのあるボディ感とコーヒーチェリーの持つフルーティ感を控えめかつメローな後味として演出させています。\r\nコーヒーが苦手な方にも飲みやすいマイルドなブレンドです！\r\n　\r\n■配送方法 レターパックプラス\r\n■内容量　ドリップパックコーヒー12ｇ×10袋\r\n\r\n※通常価格2020円（レターパックプラス送料込）のところ、訳ありのため\r\n今回限り1200円でお届けします。','訳ありの商品ですが、お買い上げいただきありがとうございました。\r\n励みになります。\r\n','',NULL,NULL,'ドリップパックコーヒー','お試し価格','訳あり','限定','','kPe7KqMlwzxmrXNR.jpg','','','','',NULL,NULL,NULL,NULL,NULL,2,0,0,0,0,20,'送料込み','普通郵便（定型・定形外）','熊本県','2～3日で発送','1','レターパックプラス送料込です。',0,1,NULL,'2020-09-28 18:21:26','2020-10-02 13:28:16'),(262,121,'茨城県産　栗　2Lサイズ　1.3キロ越え',1000,NULL,'野菜・その他野菜','茨城県で育てた愛情たっぷりの栗です！\r\n\r\n2Lサイズは、一粒20g以上のものです。\r\nコンパクト便にて、1.3キロ越え\r\n\r\n選別時に虫食いや傷みが無いか、確認してか