,NULL,'果物・その他果物','এটি বাংলাদেশে উত্পন্ন কুমড়ো। আমি আশা করি আপনি এটি খুব সুন্দর পাবেন। গ্রামীণ কৃষকরা কুমড়োর বাগানটি দখল করেছেন, এতে প্রচুর কুমড়ো রয়েছে এবং সর্বদা বাজারে থাকে।\r\n\r\nআপনি আরইএল কয়েন সহ এই কুমড়োটি কিনতে পারেন।','আপনার ক্রয় করার জন্য আপনাকে ধন্যবাদ.','',NULL,NULL,'শাকসবজি','কুমড়া','বাংলাদেশ','','','qerKsxLYUT7PhaRQ.jpg','','','','',NULL,NULL,NULL,NULL,NULL,1,0,0,0,5,0,'送料込み','未定','福岡県','別途ご連絡','1','এটি অবিলম্বে ট্রাইসাইকেলের মাধ্যমে সরবরাহ করা হবে।',0,1,NULL,'2020-10-02 04:05:02','2020-10-02 04:25:24'),(287,108,'[পরীক্ষা] রক্ষা শিমাগারফিশ',1200,NULL,'魚介類・その他魚介類','এই মাছটিকে মাঝের ফিশ বলা হয়। প্রচুর রক্ত ​​ও প্রোটিন রয়েছে। মানুষ এই মাছগুলি বাড়ায়। মাছ খুব সুস্বাদু। এরা খুব বড় এবং অনেক ধরণের খাবার খেয়ে বেঁচে থাকে। বাংলাদেশে ঘরে ঘরে কয়জন মানুষ মাছ চাষ করেন? এই মাসটিকে রক্ষা শিমাগারফিশ বলা হয়। এই মাছটি দেহে প্রোটিন সরবরাহের জন্য দায়ী। ম্যাগজারফিশ হ\'ল মিঠা পানিতে চাষ করা একটি মাছ।\r\n\r\nএই মাছটি আরইএল কয়েন দিয়ে কেনা যায়। এবং আমরা এটি জীবিত প্রদান করব।','আপনার ক্রয় করার জন্য আপনাকে ধন্যবাদ','',NULL,NULL,'মাছ','মিঠাপানির মাছ','বাংলাদেশ','','','AG72VVwm434y4nAs.jpg','','','','',NULL,NULL,NULL,NULL,NULL,1,0,0,0,5,0,'送料込み','未定','福岡県','別途ご連絡','1','থ্রি-হুইল সাইকেল সরবরাহ করে।',0,1,NULL,'2020-10-02 04:20:18','2020-10-02 04:25:59'),(288,108,'',NULL,NULL,'野菜・じゃがいも','','','',NULL,NULL,'','','','','',NULL,'','','','',NULL,NULL,NULL,NULL,NULL,0,0,0,0,5,1,'','','','',NULL,NULL,0,0,NULL,'2020-10-02 07:14:05','2020-10-02 07:14:09'),(289,108,'',NULL,NULL,'野菜・じゃがいも','','','',NULL,NULL,'','','','','','','','','','',NULL,NULL,NULL,NULL,NULL,0,0,0,0,5,1,'','','','',NULL,NULL,0,0,NULL,'2020-10-02 07:14:12','2020-10-02 07:14:12'),(290,155,'北海道産訳ありにんじん8kg',1700,NULL,'野菜・にんじん','北海道産とれたてにんじんです！\r\n毎年人気の甘いにんじん。\r\nにんじんジュースなら、りんご等入れなくても美味しくつくれます！\r\n','この度はご購入ありがとうございます！\r\n収穫したその日のうちに発送致しますので、新鮮な状態でお届けします。\r\n到着まで今しばらくお待ちくださいませ。','',NULL,NULL,'人参','北海道','','','','ctZWZaJlOnoYa9GZ.jpg','','','','',NULL,NULL,NULL,NULL,NULL,0,0,0,0,1,1,'送料込み','宅配便','北海道','2～3日で発送'