て出荷しています。\r\nデザートに合うよう、甘味と酸味のバランスが取れた品種で、生食にも向いています。\r\n\r\nもう一種類の「赤い妖精」は、クレープに添えられるジャムに加工されるなど“業務用”として出荷しています。\r\n果肉が赤色のため、加工時にきれいに発色し、酸味があり果肉がしっかりとしているため、ジャムや果実酒など、甘い物（糖類）と一緒に加工すると味が引き立ちます。\r\n\r\n品種ミックスでバラ詰めします。\r\n規格外品のため、スレ傷穴、形がいびつな物、小粒、種が寄っている物、着色不良果が中心となります。\r\n\r\n腐っている、食害のある物は、極力混入しないよう留意して箱詰めしますが、規格外品のため混入したり、輸送中に傷む物が出てくる場合があります。予めご了承ください。\r\n\r\n加工の際、種が寄っている部分、スレ傷穴、傷んだ部分は、取り除いてご利用ください。\r\n\r\n箱内に緩衝材を使用して詰めますが、輸送上、痛み・腐れ等生じる恐れがあります。\r\n\r\n訳あり品のため、格安でご提供しております。\r\n商品説明をよく読み、ご納得いただいた上でご注文をお願いいたします。\r\nご不明な点がありましたら、ご注文前にご質問ください。\r\n\r\n予告なく商品の出品キャンセル・中止する場合があります。\r\n\r\n発送は、受注から7日以内を目安に発送されます。\r\n\r\n上記の点をご了承の上、ご購入くださいますようお願い申し上げます。','ご購入くださりありがとうございます。\r\n発送まで今しばらくお待ちください。','',NULL,NULL,'イチゴ','苺','ジャム','ケーキ','手作り','b84nvyMd6MEHQOcy.jpg','YmJ7nRV93RDyvXz0.jpg','GMZ1kgHP94RQJMRB.jpg','YBDRT8BR1TMF3KeC.jpg','fOlkNJQrezAqTITR.jpg',NULL,NULL,NULL,NULL,NULL,2,0,0,0,0,3,'着払い(購入者負担)','クール便','青森県','4～7日で発送','12345','ヤマト運輸クール便での発送となります。',0,1,NULL,'2020-10-12 01:11:35','2020-10-14 09:50:47'),(371,0,'',NULL,NULL,'野菜・じゃがいも','','','',NULL,NULL,'','','','','','PiF8I0oOhxYN0QYu.jpg','','','','',NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,1,'','','','',NULL,NULL,0,0,NULL,'2020-10-12 01:16:23','2020-10-12 01:17:31'),(372,160,'【加工用】夏秋いちご規格外品　内容量約1.2kg',1600,NULL,'果物・いちご','本州最北の地、下北半島。\r\nその東端に位置する東通村 にて、『夏秋いちご』という作型でいちごを栽培しています。\r\n下北地域には“やませ”と呼ばれる偏西風が夏場に吹き、全国的に暑さが厳しい時期でも、冷たい風が吹くことで冷涼な気候となります。そういった環境が、夏秋いちごの栽培に適しているため、国産いちごが市場から減少する時期に、出荷することが可能です。\r\n\r\n小売に出回らないこの品種、ぜひ一度ご賞味ください\r\n\r\n==============================\r\n\r\n【※ご注意※】\r\nこちらの商品は、色形大きさが出荷に向かない、不揃いいちごが主で、原形を留めた用途には不向きな商品です。\r\n\r\n夏秋いちご（品種：すずあかね、赤い妖精）の規格外品（大きさ、色形不揃い）を、品種ミックスで、出荷用段ボール箱に詰めて発送いたします。\r\n\r\n規格外品のため、加工用としてお買得にご提供させていただきます。\r\n内容量を確保するために、箱にぎゅうぎゅうに詰めます。一部、中身が潰れてお手元に届く場合がございます。\r\n\r\nいちごは季節によって大きさや色形・味が異なります。予めご了承ください。\r\n\r\n当方で栽培している「すずあかね」は、ケーキなどのデザートに添えられる“業務用”として出荷しています。\r\nデザートに合うよう、甘味と酸味のバランスが取れた品種で、生食にも向いています。\r\n\r\nもう一種類の「赤い妖精」は、クレープに添えられるジャムに加工されるなど“業務用”として出荷しています。\r\n果肉が赤色のため、加工時にきれいに発色し、酸味があり果肉がしっかりと