INSERT INTO `whatsnews` VALUES (1,'2018-12-07',NULL,'フリマサイト構築CMSを発表しました！','',1,'2018-11-10 03:09:07','2020-09-02 18:18:56'),(2,'2020-08-29',NULL,'<a href=\"https://google.com\">テスト</a>が追加されました。','',1,'2019-03-28 09:54:53','2020-09-26 17:03:50'),(3,NULL,NULL,'','',1,'2019-04-08 21:40:53','2019-08-29 11:15:05'),(4,'0000-00-00',NULL,'<a href=\"/admin/\">リンクチェック</a>','',1,'2019-12-05 13:46:51','2020-01-20 14:44:41'),(5,'2020-09-28',NULL,'RELEASEコマースは、2020年9月28日13:00にオープンいたします。\r\nご不明な点等ございましたら、ページ下部の「お問い合わせ」よりお問い合わせください。','',0,'2020-09-26 17:03:46','2020-09-27 00:27:51'),(6,'2020-09-28',NULL,'RELEASEコマースの新規登録について\r\n\r\n※RELEASEコマースへの新規登録の際、当サイトからのメールは「noreply@release.co.jp」から届きます。\r\n「noreply@release.co.jp」からのメールを受信できる様、ドメイン設定を解除していただくか、または弊社ドメイン『release.co.jp』を受信リストに加えていただきますよう、会員登録前にあらかじめご自身のパソコンやスマートフォンのメール設定のご確認をお願いいたします。\r\n\r\n※迷惑メール防止機能により、新規登録完了メールが迷惑メールと判断されててしまう場合がございます。\r\n迷惑メールフォルダやゴミ箱に自動的に振り分けられている可能性がありますので、一度ご確認頂きますようお願い致します。','',0,'2020-09-26 17:04:53','2020-09-26 17:05:26'),(7,'2020-09-29',NULL,'食のオンラインマーケット「RELEASEコマース」「新規登録キャンペーン」実施中！\r\n\r\n\r\n食のオンラインマーケット「RELEASEコマース」のリニューアルオープンを記念して2020年9月28日13時より「新規登録キャンペーン」を実施しています。\r\n\r\n食のオンラインマーケット「RELEASEコマース」に新規登録（無料）（出品目的でも購入目的でもどちらでも対象）すると、ショッピングに使えるポイント300ポイントをもれなく進呈致します。\r\n\r\n\r\n【RELEASEコマース新規登録キャンペーン概要】\r\n\r\n■キャンペーン期間：2020年9月28日（月）13:00 ～ 2020年10月26日（月） 12:59まで（31日間）\r\n\r\n【注意事項】\r\n※当キャンペーンは予告なく終了する場合がございます。予めご了承くださいませ。\r\n\r\n※当キャンペーン期間における獲得ポイントは即時付与されます。（諸般の事情により付与が遅れる場合もございます。予めご了承くださいませ。）\r\n\r\n※二重登録等の不正な利用が確認された場合にはアカウントを削除させて頂く場合がございます。その場合、特典ポイントも無効となりますので予めご了承ください。\r\n\r\n※当キャンペーンにより獲得したポイントは換金やお買い物で利用される前に退会されますと無効となりますのでご注意ください。\r\n\r\n\r\n●RELEASEコマースへの登録は、ページ上部の【新規登録】ボタンよりお願いいたします。','',0,'2020-10-01 18:21:46','2020-10-01 18:23:10'),(8,'2020-10-06',NULL,'食のオンラインマーケットRELEASEコマースは、RELEASEコマースを、より気軽に・より多くの方にお試し頂きたく、「販売手数料無料キャンペーン」を開始します。\r\n\r\n通常、8％かかる販売手数料を対象期間中に売り上げた商品に限り手数料を実質無料と致します。\r\n\r\nRELEASEコマースの登録と出品は無料！さらに、今回のキャンペーンにより販売手数料も実質無料となることで、より気軽にRELEASEコマースをお試し頂けます！\r\n\r\n【RELEASEコマース販売手数料無料キャンペーン概要】\r\n\r\n■キャンペーン対象期間：2020年10月6日（火）17:00 ～ 2020年10月20日（火） 16:59まで（15日間）\r\n\r\n■適用条件：キャンペーン対象期間中に販売された商品の取引完了、換金申請後、売上金振込時に販売手数料相当分を還元致します。\r\n※システムの都合上、売上金の換金申請時点では8％の販売手数料が反映されております。\r\n\r\n【注意事項】\r\n※当キャンペーンは予告なく終了する場合がございます。予めご了承くださいませ。\r\n\r\n※キャンペーン対象期間に決済処理が完了した売上のみ対象となります。出品日ではありませんのでご注意ください。\r\n\r\n※食品以外は出品できませんのであらかじめご了承くださいませ。','',0,'2020-10-15 14:29:43','2020-10-15 14:29:43');
